export function RegionSVG({ regionCode, className, fill = "#6A6AF4" }: RegionSVGProps) {
  const regionData = REGION_DATA[regionCode];

  if (!regionData) {
    return null;
  }

  return (
    <span className={className}>
      <svg
        viewBox={regionData.viewBox}
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        preserveAspectRatio="xMidYMid meet"
      >
        {regionData.paths.map((d, index) => (
          <path key={index} d={d} fill={fill} />
        ))}
      </svg>
    </span>
  );
}
